import React from "react";
import "./Header.css";
import Logo from "../../assets/Logo.png";

const Header = () => {
  return (
    <div className="header">
      <img src={Logo} alt="" className="logo" />

      <ul>
        <li>Home</li>
        <li>Our Team</li>
        <li>Get Started</li>
        {/* <li></li> */}
      </ul>
    </div>
  );
};

export default Header;
